import React, { useState } from 'react';

export default function DishSelect(props) {
    const {dishes} = props;

    return (
        <div>
            <h1>
                select your dishes!
            </h1>
            {dishes.map((dish, index) => <p>dish</p>)}
        </div>

    )
}
